import React from 'react'
import Lottie from 'react-lottie';


function Animation(props) {

    const defaultOptions = {
        loop: false,
        autoplay: props.auto,
        animationData: props.ani,
        renderer: 'svg'
    }

  return (
    <div>
               <Lottie
                options={defaultOptions}
                height={500}
                width={500}
               />
            </div>
  )
}

export default Animation;
